import * as React from 'react';
import Link from '@material-ui/core/Link';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Title from './Title';
import Paper from '@material-ui/core/Paper';
import { Container } from '@material-ui/core';


function preventDefault(event) {
  event.preventDefault();
}

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },
  toolbar: {
    paddingRight: 24, // keep right padding when drawer closed
  },
  toolbarIcon: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'flex-end',
    padding: '0 8px',
    ...theme.mixins.toolbar,
  },
  appBar: {
    zIndex: theme.zIndex.drawer + 1,
    transition: theme.transitions.create(['width', 'margin'], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
  },
  appBarShift: {
    marginLeft: drawerWidth,
    width: `calc(100% - ${drawerWidth}px)`,
    transition: theme.transitions.create(['width', 'margin'], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen,
    }),
  },
  menuButton: {
    marginRight: 36,
  },
  menuButtonHidden: {
    display: 'none',
  },
  title: {
    flexGrow: 1,
  },
  drawerPaper: {
    position: 'relative',
    whiteSpace: 'nowrap',
    width: drawerWidth,
    transition: theme.transitions.create('width', {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen,
    }),
  },
  drawerPaperClose: {
    overflowX: 'hidden',
    transition: theme.transitions.create('width', {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
    width: theme.spacing(7),
    [theme.breakpoints.up('sm')]: {
      width: theme.spacing(9),
    },
  },
  appBarSpacer: theme.mixins.toolbar,
  content: {
    backgroundColor:
      theme.palette.mode === 'light'
        ? theme.palette.grey[100]
        : theme.palette.grey[900],
    flexGrow: 1,
    height: '100vh',
    overflow: 'auto',
  },
  container: {
    paddingTop: theme.spacing(4),
    paddingBottom: theme.spacing(4),
  },
  paper: {
    padding: theme.spacing(2),
    display: 'flex',
    overflow: 'auto',
    flexDirection: 'column',
  },
  fixedHeight: {
    height: 250,
  },
}));

const DeckList = (props) => {
  const classes = useStyles();

  const [showDeck, chooseDeck] = React.useState([])

  React.useEffect(()=>{
    const fetchDeck = () => {
      fetch(`http://localhost:3001/decks/${props.selectedDeck}`)
      .then(res=>res.json())
      .then(deck => chooseDeck(deck))
    }
    fetchDeck();
    },[props.selectedDeck]
  )

  const renderTable = ()=>{
    if(showDeck !== []){
      debugger
      return(
      <TableBody>
        {showDeck.cards.map((card) => (
          <TableRow key={card.id}>
            <TableCell>Number</TableCell>
            <TableCell>{card.name}</TableCell>
            <TableCell>{card.mana_cost}</TableCell>
            <TableCell>{card.cardtype}</TableCell>
            <TableCell>{card.rarity}</TableCell>
            {/* <TableCell align="right">{`$${row.amount}`}</TableCell> */}
          </TableRow>
        ))}
      </TableBody>
      )
    }
  }

  return (
    <Container className={classes.container}>
      <Paper>               
          <Title>Recent Orders</Title>
          <Table size="medium">
            <TableHead>
              <TableRow>
                <TableCell>Quantity</TableCell>
                <TableCell>Name</TableCell>
                <TableCell>CMC</TableCell>
                <TableCell>Type</TableCell>
                <TableCell>Rarity</TableCell>
                <TableCell align="right">Total Price</TableCell>
              </TableRow>
            </TableHead>
            {renderTable()}
          </Table>
      </Paper>
    </Container>
  );
}

export default DeckList;
